def setup_border(dimm):
    for i in range(dimm+1):

        #upper
        screen_yt = 288 + n
        screen_x = -288 - n + i*n
        pen.goto(screen_x, screen_yt)
        pen.stamp()
        #print(screen_x, screen_yt)

        #down
        screen_yr = -288 - n
        pen.goto(screen_x, screen_yr)
        pen.stamp()
        #print(screen_x, screen_yy)

        #left
        screen_xl = -288 - n
        screen_yyy = 288 + n - i*n
        pen.goto(screen_xl, screen_yyy)
        pen.stamp()
        #print(screen_xx, screen_yyy)

        pen.goto(screen_yt, screen_yyy)
        pen.stamp()
        #print(screen_y, screen_yyy)



